import React from 'react';
import '../assets/css/locations.css'; // Locations specific styles

const Locations = () => {
  return (
    <div className="locations-container">
      <h1>Our Travel Destinations</h1>
      <div className="location-item">
        <img src="/assets/home/t1.jpg" alt="Location 1" />
        <p>Location Name 1</p>
      </div>
      <div className="location-item">
        <img src="/assets/home/t2.jpg" alt="Location 2" />
        <p>Location Name 2</p>
      </div>
      {/* Repeat for other locations */}
    </div>
  );
};

export default Locations;
